import Navbar from '../components/Navbar';
import axios from 'axios';

const Index = () => {
    return (
        <div>
            <h1>Our index page</h1>
        </div>
    )
}

Index.getInitialProps = async () => {

    const res = await axios.get("https://jsonplaceholder.typicode.com/posts")
    const { data } = res;
    console.log(data[0]);
}

export default Index;
